using System;
using System.Threading.Tasks;
using Volo.Abp.Data;
using Volo.Abp.DependencyInjection;
using Volo.Abp.Uow;
using HRManagementSoftware.Employees;

namespace HRManagementSoftware.Employees
{
    public class EmployeesDataSeedContributor : IDataSeedContributor, ISingletonDependency
    {
        private bool IsSeeded = false;
        private readonly IEmployeeRepository _employeeRepository;
        private readonly IUnitOfWorkManager _unitOfWorkManager;

        public EmployeesDataSeedContributor(IEmployeeRepository employeeRepository, IUnitOfWorkManager unitOfWorkManager)
        {
            _employeeRepository = employeeRepository;
            _unitOfWorkManager = unitOfWorkManager;

        }

        public async Task SeedAsync(DataSeedContext context)
        {
            if (IsSeeded)
            {
                return;
            }

            await _employeeRepository.InsertAsync(new Employee
            (
                id: Guid.Parse("0970ef65-38a5-4717-81bb-c6fa8c08e040"),
                employeeNumber: "",
                jobTitle: "",
                dateOfJoining: new DateTime(2006, 10, 8),
                paidLeaveBalance: 97824,
                sickLeaveBalance: 59310,
                unpaidLeaveBalance: 63265,
                baseSalary: 43278,
                identityUserId: null
            ));

            await _employeeRepository.InsertAsync(new Employee
            (
                id: Guid.Parse("40b5e7f0-156f-4b50-910c-0c0a4f800ec2"),
                employeeNumber: "",
                jobTitle: "",
                dateOfJoining: new DateTime(2013, 8, 13),
                paidLeaveBalance: 61027,
                sickLeaveBalance: 59241,
                unpaidLeaveBalance: 27843,
                baseSalary: 83409,
                identityUserId: null
            ));

            await _unitOfWorkManager!.Current!.SaveChangesAsync();

            IsSeeded = true;
        }
    }
}